import React, { Component } from "react";
import RegisterForm from "../../components/Forms/SignUpForm";
import "./Signup.css";
import { Link } from "react-router-dom";
import Button from "../../components/Button/Button";
import "./../../App.css";
import "./../../components/Greeting/Greeting";

export default function Signup() {
  return (
    <div>
      <header>
        <img
          className="arrow-back"
          src={require("./../../graphics/back_arrow_idle.png")}
          alt="back arrow"
          height="40"
          width="40"
        ></img>

        <div>
          <div className="greeting-description">Welcome to Tripsterr</div>
          <div className="greeting-headline">Sign Up</div>
        </div>

        <img
          className="paper-plane"
          src={require("./../../graphics/message_idle.png")}
          alt="Tripster Logo"
          height="40"
          width="40"
        ></img>
      </header>

      <div className="centering">
        <RegisterForm />
      </div>

      <div className="centering"></div>
    </div>
  );
}
